  \"2013-03-16T00:57:38.222280\",\n\t\"name\": \"telluric-and-d-c-resistivity-techniques-applied-to-the-geophysical-investigation-of-basin-and-r880d3\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This paper describes a natural field electrical
  exploration technique, the E-field ratio telluric method. The method employs a collinear
  three-electrode array to measure successive electric field ratios as the array is
  leap-frogged along a survey line. The 0.05 and 8 Hz responses observed over numerous
  simple resistivity structures, based upon numerical modeling, are presented. From
  the model study it can be concluded that: th~ method is well suited for the rapid
  electrical reconnaissance exploration of survey areas of several hundred square
  kilometers, in search of deep conductive targets such as might be associated with
  hydrothermal systems; the frequencies used for the model study (0.05 and 8 Hz) are
  appropriate to exploration in Basin and Range valleys, and afford a rudimentary
  means of depth discrimination.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
